sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	var reqbody = {};
	reqbody['title'] = inputs.title;
	if (inputs.customer_type == "account")
		reqbody['customerid_account@odata.bind'] = "/accounts(" + inputs
		.customer + ")";
	else if (inputs.customer_type == "contact")
		reqbody['customerid_contact@odata.bind'] = "/contacts(" + inputs
		.customer + ")";
	reqbody['casetypecode'] = inputs.case_type ? inputs.case_type :
		undefined;
	reqbody['primarycontactid@odata.bind'] = inputs.primary_contact ?
		"/contacts(" + inputs.primary_contact + ")" : undefined;
	reqbody['description'] = inputs.description ? inputs.description :
		undefined;
	reqbody['isescalated'] = inputs.is_escalated == "yes" ? true : false;
	reqbody['prioritycode'] = inputs.priority ? inputs.priority : undefined;
	reqbody['emailaddress'] = inputs.email_address ? inputs.email_address :
		undefined;

	if (inputs.additional_fields) {
		try {
			var FieldsArr = inputs.additional_fields.trim().split(/\^/);
			for (var i = 0; i < FieldsArr.length; i++) {
				var nameValuePair = FieldsArr[i].split(/=(.+)/);
				var keyValueJson = new MicrosoftDynamicsCRMUtils().getValue(
					nameValuePair[0], nameValuePair[1]);
				reqbody[keyValueJson.key] = keyValueJson.value;
			}
		} catch (e) {}
	}
	outputs.reqbody = JSON.stringify(reqbody);
})(inputs, outputs);

