sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	if (inputs.status_code == "201") {
		outputs.status = "Success";
		outputs.case_id = (JSON.parse(inputs.response)).incidentid;
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.createACaseErrorHandler(inputs, outputs);
})(inputs, outputs);

